INSERT INTO `ui_design` (`id`, `s6_title`, `s7_title`, `s7_body`, `s7_image`, `s6_body`, `s5_title`, `s5_body`, `s4_title`, `s4_body`, `s4_image`, `s3_title`, `s3_body`, `s3_image`, `s2_image`, `s2_title`, `s2_body`, `s1_title`, `header_title`, `header_body`, `nav_type`, `created_at`, `updated_at`) VALUES
(1, 'Get an account that suits you', 'What our client say about us', 'Due to our line fast, secure, and reliable services our client chooses us.', 'section4_1581766093.png', 'We want to create superior value for our clients, shareholders and employees. And we want to stand out as a winner in our industry: for our expertise, advice and execution, our contribution to society, our work environment, and our business success.', 'Build your savings without even trying.', 'Turn on Round-up Rules and start saving up effortlessly. Whenever you make a purchase, Goals make it easy to save for the things you want or want to do. Theres no need for spreadsheets or extra apps to budget and track your money.', 'Make plans for what to do, not whats due.', 'Set up your recurring expenses (think power bill, cable, internet) in our app, and we\'ll do the work of saving for them each month. When you know your bills are covered, you can focus on the fun parts of having moneylike saving for a trip to Japan and buying that new bike.', 'section3_1581869693.png', 'What are your goals?', 'Whatever stage of life youre at, we can guide you through the opportunities and challenges you face. Your investment goals may be different, but here are some examples of the sort of questions our wealth planners can help you answer.', 'section2_1581766025.png', 'section1_1581765438.png', 'Financial intermediaries', 'Our solutions for independent financial advisors and wealth managers include research, infrastructure and a broad range of products and services.We offers high net worth and affluent individuals around the world a complete range of tailored advice and investment services. Our spectrum ranges from investment management to estate planning and corporate finance advice, in addition to specific wealth management products and services.', 'Market leaders use app to reach their brand & business.', 'Personal Banking, Loans, Cards & More', 'We help our clients to extend their offers and transform their cost structures. Services include market intelligence, business execution, liquidity provision, processing, and client servicing.', 1, '2020-12-05 13:00:34', '2020-12-05 12:00:34');
